    data: |
      SELECT ALL + col0 * - 70 AS col0 FROM tab1 (FORMAT parquet) WHERE ( - col0 + col0 ) NOT BETWEEN + 15 AND NULL;
  - name: tab1

outputs:
  - name: q165.out
    data: |
      -3570
      -5950
      -6370
